  [1238652, 126, "2216c625-adf0-46a8-ab74-3cef0a74819c", "rent", "residential", "flat", false, 21, 593, 15081, "Проспект Октябрьской революции 22", nil, nil, "44.591753", "33.453501", false, nil, nil, nil, nil, nil, 1, nil, 33.0, 17.0, [], 8.0, nil, nil, nil, 4, 9, nil, "Сдам 1 к/к люкс с евро с камином возле Парка Победы", nil, "\nЦена Летом от 300 грн. Вне сезона от 200 -250 в зависимости от месяца\n\nКвартира от собственника на Проспекте Октябрьской революции 22 , 4 этаж. Парк Победы 7 мин. пешком.\n\nЕВРОРЕМОНТ: Потолок в комнате натяжной , в ванной, кухне и в коридоре потолок -пластик, в кухне стены и в комнате - дорогие обои, стены в коридоре-жидкие обои. Полы в комнате -ламинат, полы в кухне и в коридоре-кафель с подогревом. .Входная дверь двойная, современная мебель, новая техника.\n\nКвартира рассчитана на 2-3 человека, двуспальный диван и диван 1м 20 см.\n\nВОЗЛЕ ДОМА в 50-200 метрах остановка, супермаркет, автостоянка, магазины и ларьки( молочная продукция, хлебный, овощной, колбасы, бытова химия), парикмахерская.\n\nНЕДАЛЕКО в 10 мин. ходьбы от дома пиццерия, суши бар, много магазинов и ларьков, цирк, детский парк с аттракционами.\n\nВ КВАРТИРЕ ИМЕЕТСЯ: Кондиционер, горяча вода - бойлер на 80 л, беспроводной интернет WI-FI, Фен, ЖК-телевизор 42 дюйма, спутниковое ТВ, утюг и гладильная доска,\n ПРЕДОСТАВЛЯЮ хорошее постельное белье и банные принадлежности, освежитель воздуха, жидкое мыло, шампунь.\n\nОборудованная всем необходимым кухня с холодильником, микроволновкой, посудой и эл.чайником.\n\nДо моря 10 мин.пешком.ПЛЯЖИ: Парк Победы - мелкая галька , Аквамарин- песочный (находится на территории Парка Победы) , Омега - песочный -\n\nДО ЦЕНТРА можно доехать на маршрутке за 10 минут, до Торгово-развлекательного комплекса \" АПЕЛЬСИН\" за 2 минуты, до Торгово-развлекательного комплекса\" МУССОН\" ( каток, кинотеатр, бильярд, боулинг, супермаркет, аптеки, игровые автоматы, детский парк для самых маленьких, развлечения для взрослых и детей, много магазинов: б