room: with Shower, 1 large Bath, Toilet, Bidet\n2nd Bathroom: with Shower and Toilet\nElectronic safe in both bedrooms\nHair dryer\nVacuum cleaner\nComplete sets of linen and towels\n\nWe can provide in Kharkov interpretation services, transfer, guide, bodyguards, driver, car and phone rental, delivery and cooking food, other services.\n\nApartments owned Irish art gallery \"Wicklow art gallery\" (http://www.thewicklowartgallery.com) :\n\n\n\nRathnew,\nCounty Wicklow.\nIreland\n\n\nContacts are in Ukraine:\nEmail: 380686036454@mail.ru\n\nTranslator / guide Nastya (English, Ukrainian, Russian and French languages): Tel. 38 0935936437, Skype: anastasia-vasilenko\n\nManager Igor (Russian l.) 38 0686036454\n+++++++++++++++++++++++++++++++++++++++\n\nУкраина, Харьков. Апартаменты высокого европейского класса - в аренду.\n\nАренда для краткосрочной или долгосрочной перспективы.\nЭта квартира находится в превосходном состоянии внутри и снаружи, класса AAA Business Standard .\n\nНовое здание ( 2010г. ). Жилой комплекс \"Источник\".\n\nУкраина , Харьков.\nОтакара Яроша ул., 24 \"б\", 5 -й этаж, 120 кв.метров.\nСтудия (диван-кровать). 2 спальни (двуспальные кровати) и две ванные комнаты. Спальных мест: 2+2+2\n\nПодземная охраняемая парковка 3x6м.\nКондиционирование и центральная отопительная система.\nOtis лифты.\nСистемы безопасности и охраны: дома, квартиры, подземного паркинга. Система электронного доступа.\n\nЖители, в основном, бизнес - класс.\nОбщественный транспорт, метро \"Ботанический сад\" 100 метров. (Две остановки от центра города).\nВид на Ботанический сад (50 метров) с большым парком для прогулок \"Саржин Яр\".\n\nОбщедоступный природный источник минерально - столовой воды \"Харьковская-1\". \nСупермаркеты, рестораны национальных кухонь мира, бары, ирландский паб, спа-салоны, ... 50 - 100 метров.\n\nКвартира:\n\n\nСуществует большие окна на Восток и Запад\n3 больших балкона с креслами и столом для отдыха.\nСтены украшены картинами известных украинских и ирландских художников\nБиблиотека книг, DVD -дисков на различных языках\nВидеодомофон\nТелефон (городской)\n2 телевизора. В том числе 42 \"( спутниковое телевидение, местное телевидение ), 2 DVD's\nКондиционер\nИнтернет (кабель, Wi -Fi , IP -TV)\nОфисное оборудование (компьютер ( по заявке), факс, копир, принтер, аксессуары для сотовых телефонов, компьютеров ....)\nСистема фильтрации воды\nЭлектрическая плита и духовка, встроенный холодильник - морозильник, обеденный наборы, кухня, бытовая техника\nСтол и стулья для 10 человек, место для обеда\nОбе спальни имеют большие кровати и большие встроенные зеркальные шкафы\nПервый ванная комната: с душем, 1 большая ванна на 370 литров, унитаз, биде, стральная машина\nВторая ванная комната с душем и унитазом\nЭлектронные сейфы в обеих спальнях\nФен\nПылесос\nКомплекты белого цвета постельного белья и полотенец (индивидуальная стирка, ручная глажка)\n\nМы, в дополнение, можем предоставить в Харькове услуги: юридические, переводческие, трансфер из аэропортов Украины в Харьков, гида, телохранителя, водителя, автомобиль и с/телефон в аренду, доставка или приготовление пищи, доставка подарков и другие услуги.\n\nКвартира, принадлежит ирландской художественной галерее \"Wicklow art gallery\" (http://www.thewicklowartgallery.com):\n\n\nРатнью,\nУиклоу .\nИрландия\n\n\n\nКонтакты в Украине:\n Менеджер Игорь, телефон: 38 0686036454, E-mail: 380686036454@mail.ru\n", nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, nil, 2300.0, "USD", nil, "month", nil, 2300.0, 19.1667, nil, nil, nil, nil, nil, true, nil, false, nil, nil, nil, true, "2014-04-12 17:25:23", false, "(068)603-64-54", nil, nil, nil, "Игорь", nil, true, false],
